    render() {

        return (
            <div id="blog">
                <Slider
                    title="Blog"
                    
                />
                <div className="center">
                    <div id="content">
                       {/*Listado de articulos que vendran de la api de node */}
                    </div>
                    <Sidebar />
                </div>
                
            </div>


        );
    }
}

export default Blog;
